script: |
  super -f text -I q8859.spq | sort > q8859.out

inputs:
  - name: q8859.spq
    data: |
      SELECT ALL ( - col1 ) * + col2 FROM tab0 (FORMAT parquet) WHERE NOT NULL NOT BETWEEN + ( ( - col1 ) ) AND 48 - - CAST ( + CAST ( NULL AS REAL ) + 58 AS INTEGER );
  - name: tab0

outputs:
  - name: q8859.out
    data: |
